    def test_thinned_tokyo(self):
        # Zoom 8 should have Tokyo
        self.assert_has_feature(
            8, 227, 100, 'places',
            {'kind': 'locality', 'id': 4})
        # ... but should not have the nearby small locality Chiyoda
        self.assert_no_matching_feature(
            8, 227, 100, 'places',
            {'kind': 'locality', 'id': 143})
        # We should thin out most of the data at zoom 8
        self.assert_n_matching_features(
            8, 227, 100, 'places',
            {'kind': 'locality'}, 134)

        # Zoom 11 should have Tokyo
        self.assert_has_feature(
            11, 1819, 806, 'places',
            {'kind': 'locality', 'id': 4})
        # .. and SHOULD have the nearby small locality Chiyoda
        self.assert_has_feature(
            11, 1819, 806, 'places',
            {'kind': 'locality', 'id': 143})
